                parent.append('<input class="input-number" type="text">');
                el.hide();
                var newEl = el.next();
                newEl.addClass(classes);
                var attrValue;

                function setInputAttr(attrName) {
                    if (el.attr(attrName)) {
                        attrValue = el.attr(attrName);
                        newEl.attr(attrName, attrValue);
                    }
                }

                setInputAttr('value');
                setInputAttr('placeholder');
                setInputAttr('min');
